import React from "react";

import characters from "../assets/characters.json";

const Pokemons = () => {
  return (
    <div className="pokemon-list">
      {characters.map((pokemon) => (
        <div key={pokemon.id}>
          {" "}
          {/* Use key for better performance in list rendering */}
          <p>{pokemon.name}</p>
          <p>{pokemon.type}</p>
        </div>
      ))}
    </div>
  );
};

export default Pokemons;
